import React from "react";
import "../style/home.css";

class HomePage extends React.Component {
  render() {
    return (
      <div className="center">
        <h2>Please enter your delivery information:</h2>
        <form>
          <fieldset>
            <label>Address:</label>
            <input></input>
            <label>Province:</label>
            <input></input>
            <label>City:</label>
            <input></input>
          </fieldset>
        </form>
      </div>
    );
  }
}

export default HomePage;
